import React from "react";
import './nav.css';

function Nav () {
    return (
        <nav>
            <ul>
                <li><a href="#"><i className="fa-regular fa-house"></i><span>Home</span></a></li>
                <li>About</li>
                <li>Skills</li>
                <li>Projects</li>
                <li>Contact</li>
            </ul>
        </nav>
    );
}

export default Nav;
